import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

import Users from "./Users";
import Articles from "./Articles";
import Comments from "./Comments";

class App extends Component{


  render() {

    return(
      <Router>
        <div>
          <Link to={'/users'} className="nav-link">Users</Link>
          <Link to={'/articles'} className="nav-link">Articles</Link>
          <Link to={'/comments'} className="nav-link">Comments</Link>
          <Switch>
            <Route exact path='/users' component={() => <Users value={this.props.value} />} />
            <Route exact path='/articles' component={ () => <Articles value={this.props.value} />} />
            <Route exact path='/comments' component={ () => <Comments value={this.props.value} />} />
          </Switch>
        </div>
      </Router>
    )
  }
}
export default App;
